import "./App.css";
import { Routes } from "react-router-dom";
import { Route } from "react-router-dom";
import LandingPage from "./components/LandingPage/LandingPage";

function App() {
  return (
    <Routes>
      <Route path="/" element={LandingPage}>
        <div className="App">
          <h1>Henry Dogs</h1>
        </div>
      </Route>
    </Routes>
  );
}

export default App;
